import {React, useEffect, useState} from 'react';
import axios from "axios";
import Cookies from "universal-cookie";

const cookies = new Cookies();
const token = cookies.get("TOKEN");

const NavBar = () => {
    const [message, setMessage] = useState("");
    
    useEffect(() => {
        const config = {
            method: "get",
            url: "http://localhost:5000/admin-endpoint",
            headers: {
                Authorization: `Bearer ${token}`,
            },
        };
        axios(config)
        .then((result) => {
            setMessage(result.data.message);
        })
        .catch((e) => {
            e = new Error();
        });
    }, []);

    if(message){return (
        <div class="sticky-top">
                <Nav class="navbar navbar-expand-lg bg-body-tertiary">
                    <div class="container-fluid">
                        <a class="navbar-brand" href="/">Navbar</a>
                        <div class="collapse navbar-collapse" id="navbarSupportedContent">
                            <ul class="navbar-nav me-auto mb-2 mb-lg-0">
                                <li class="nav-item">
                                <a class="nav-link" href="/product">Clothes</a>
                                </li>
                                <li class="nav-item">
                                <a class="nav-link" href="#">Merch</a>
                                </li>
                                <form class="d-flex" role="search">
                            </form>
                            </ul>
                            <div class="hstack gap-3">
                                <div class="p-2 ms-auto"><a class="btn btn-success" variant="success" href="/add">Add</a></div>
                                <div class="vr"></div>
                                <div class="p-2"><button class="btn btn-danger" variant="danger" type="submit" onClick={() => logout()}>Logout</button></div>
                            </div>
                        </div>
                    </div>
                </Nav>
            </div>
        )
    }
    else {
        return (
            <div class="sticky-top">
                <Nav class="navbar navbar-expand-lg bg-body-tertiary">
                    <div class="container-fluid">
                        <a class="navbar-brand" href="/">Navbar</a>
                        <div class="collapse navbar-collapse" id="navbarSupportedContent">
                            <ul class="navbar-nav me-auto mb-2 mb-lg-0">
                                <li class="nav-item">
                                <a class="nav-link" href="/product">Clothes</a>
                                </li>
                                <li class="nav-item">
                                <a class="nav-link" href="#">Merch</a>
                                </li>
                                <form class="d-flex" role="search">
                            </form>
                            </ul>
                            <div class="hstack gap-3">
                                <div class="p-2 ms-auto"><a class="nav-link" href="/register">Register</a></div>
                                <div class="vr"></div>
                                <a class="btn p-2" variant="warning" href="/login">Login</a>
                            </div>
                        </div>
                    </div>
                </Nav>
            </div>
        )
    }
}

export default NavBar
